INSERT INTO `reportes` (`id`, `empresa_id`, `nombre_de_reporte`, `rtf_cuerpo`, `created_at`, `updated_at`) VALUES
(1, 1, 'Solicitud de Fabricacion - hoja 1', '<h1 style="text-align:center"><u>Solicitud de Fabricaci&oacute;n</u></h1><p>El Sr. (cliente_id)cliente_apellido cliente_nombre, titular del cliente_tipo_de_documento cliente_nro_de_documento&nbsp;domiciliado en calle cliente_domicilio de la ciudad/localidad de cliente_localidad&nbsp;Pcia. de cliente_provincia expresa que habiendo&nbsp; sido informado ampliamente sobre los modelos, caracter&iacute;sticas, precios y formas de pago de las viviendas que fabrica Viviendas Tecnohouse de Sistema de Viviendas Tecnohogar SRL., con domicilio en calle Marcos Ciani 3305 de la ciudad de Venado Tuerto, provincia de Santa Fe, presenta formalmente la mencionada empresa fabricante la solicitud de fabricaci&oacute;n de una vivienda industrializada TECNOHOUSE la que deber&aacute; responder a los requisitos que seguidamente se expresan:</p><h3 style="text-align:center"><u>PRIMERA</u></h3><p>OBJETO SOLICITADO: Se solicita la fabricaci&oacute;n de los elementos constitutivos de una vivienda industrializada TECNOHOUSE modelo solicitud_modelo&nbsp;/ solicitud_total_de_metros_cuadrados mts2 INTERNOS, la que consta de solicitud_total_de_metros_cuadrados mts2, cuyos ambientes , distribuci&oacute;n y medidas son las siguientes:</p><p>solicitud_componentes</p><h3 style="text-align:center"><u>SEGUNDA</u></h3><p style="text-align:justify">PRECIO: El valor total de la vivienda solicitada asciende a la suma de solicitud_suma_total, suma que el solicitante ofrece pagar de&nbsp; la siguiente forma:</p><p>UN ANTICIPO de solicitud_anticipo, el saldo de solicitud_resto se abonar&aacute; contra entrega de la vivienda solicitada. Para el caso de optar el solicitante de pagar el saldo en cuotas mensuales, dicha opci&oacute;n solo ser&aacute; procedente cuando: a) se haya abonado la totalidad del anticipo en la forma pactada y b) presente el solicitante las garant&iacute;as necesarias a satisfacci&oacute;n pura y exclusiva de la parte locadora.</p><h3 style="text-align:center"><u>TERCERA</u></h3><p>ENTREGA: El solicitante recibir&aacute; la vivienda objeto de la presente solicitud a los sesenta d&iacute;as corridos desde la cancelaci&oacute;n del anticipo y una vez cumplidos los siguientes requisitos:</p><ol>	<li>cancelaci&oacute;n del saldo del precio</li>	<li>para el caso de haber optado por el pago del saldo en cuotas, una vez cumplimentados los requisitos enunciados en la cl&aacute;usula anterior sobre el particular.</li></ol><h3 style="text-align:center"><u>CUARTA</u></h3><p>El solicitante se obliga a la firma del contrato definitivo que reglar&aacute; la totalidad de los derechos y obligaciones de las partes dentro del plazo de quince d&iacute;as corridos de aceptada la presente solicitud.&nbsp;&nbsp; La falta de celebraci&oacute;n del citado contrato dentro del plazo establecido, implicar&aacute; el desistimiento por parte del solicitante quien perder&aacute; la suma entregada en concepto de se&ntilde;a.</p>', '2018-12-17 13:59:03', '2018-12-19 19:38:22'),
(2, 1, 'Solicitud de Fabricacion - hoja 2', '<h1 style="text-align:center"><u>Solicitud de Fabricaci&oacute;n</u></h1><p>El Sr. (cliente_id)cliente_apellido cliente_nombre, titular del cliente_tipo_de_documento cliente_nro_de_documento&nbsp;domiciliado en calle cliente_domicilio de la ciudad/localidad de cliente_localidad&nbsp;Pcia. de cliente_provincia expresa que habiendo&nbsp; sido informado ampliamente sobre los modelos, caracter&iacute;sticas, precios y formas de pago de las viviendas que fabrica Viviendas Tecnohouse de Sistema de Viviendas Tecnohogar SRL., con domicilio en calle Marcos Ciani 3305 de la ciudad de Venado Tuerto, provincia de Santa Fe, presenta formalmente la mencionada empresa fabricante la solicitud de fabricaci&oacute;n de una vivienda industrializada TECNOHOUSE la que deber&aacute; responder a los requisitos que seguidamente se expresan:</p><h3 style="text-align:center"><u>PRIMERA</u></h3><p>OBJETO SOLICITADO: Se solicita la fabricaci&oacute;n de los elementos constitutivos de una vivienda industrializada TECNOHOUSE modelo solicitud_modelo&nbsp;/ solicitud_total_de_metros_cuadrados mts2 INTERNOS, la que consta de solicitud_total_de_metros_cuadrados mts2, cuyos ambientes , distribuci&oacute;n y medidas son las siguientes:</p><h3 style="text-align:center"><u>QUINTA</u></h3><p style="text-align:justify">DE LA ACEPTACI&Oacute;N: Se considerar&aacute; que el fabricante ha aceptado la solicitud cursada si dentro del plazo de diez d&iacute;as corridos de haber sido cursada la misma no ha sido&nbsp; rechazada&nbsp; fehacientemente.&nbsp; La presente solicitud es efectuada en el domicilio de Sistema Tecnohogar SRL, sito en calle Iraola 925</p><p style="text-align:justify">- Parque Industrial La Victoria de la ciudad de Venado Tuerto a los&nbsp; solicitud_dia&nbsp; d&iacute;as del mes de solicitud_mes del a&ntilde;o solicitud_anio.</p><p>&nbsp;</p><p>RECIBE POR SISTEMA TECNOHOUSE:</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%"><tbody><tr>			<td>			<p>FIRMA EMPLEADO:</p>			</td>			<td>			<p>FIRMA DEL SOLICITANTE:</p>			</td>		</tr>		<tr>			<td>..........................................................................</td>			<td>..........................................................................</td>		</tr>		<tr>			<td>ACLARACI&Oacute;N:</td>			<td>ACLARACI&Oacute;N:</td>		</tr>		<tr>			<td>			<p>..........................................................................</p>			</td>			<td>..........................................................................</td>		</tr>	</tbody></table><p>&nbsp;</p>', '2019-01-08 17:42:25', '2019-01-08 17:42:25'),
(3, 1, 'Contrato  Contado', '<p style="text-align: justify;">Entre <strong>Viviendas TecnoHouse de Sistemas de Viviendas Tecnohogar S.R.L.</strong>, con domicilio en calle <strong>Marcos Ciani 3305</strong> de la ciudad de <strong>Venado Tuerto</strong>, provincia de <strong>Santa Fe</strong>, por una parte y en adelante llamada LA LOCADORA y el/la <strong>Sr./Sra.</strong> cliente_nombre cliente_apellido titular del cliente_tipo_de_documento cliente_nro_de_documento con domicilio real en cliente_domicilio de la ciudad de cliente_localidad, provincia de cliente_provincia por otra parte y, en adelante llamada EL/LA LOCATARIO/A, se conviene la celebraci&oacute;n del presente contrato, el que se regir&aacute; por lo dispuesto por las cl&aacute;usulas y supletoriamente por lo dispuesto en el C&oacute;digo Civil en lo que fuera pertinente.</p><p style="text-align: justify;"><strong><u>PRIMERA: </u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A solicita a LA LOCADORA :</p><ol>	<li style="text-align: justify;">La fabricaci&oacute;n de elementos constitutivos de una vivienda MODELO solicitud_modelo / solicitud_total_de_metros_cuadrados mts2 INTERNOS, de solicitud_total_de_metros_cuadrados m2 de superficie cubierta, medidas interiores en metros y conforme las condiciones t&eacute;cnicas que se se&ntilde;alan en el ANEXO I, que forma parte integrante del presente contrato.</li>	<li style="text-align: justify;">El armado de la vivienda a que se refiere el punto A.</li></ol><p style="text-align: justify;">El presente contrato no involucra una vivienda llave en mano, encontr&aacute;ndose sujeto a las condiciones particulares de cada caso.<br /><strong><u>LA LOCADORA</u></strong> se obliga al cumplimiento del objeto solicitado, fijando ambas partes que la fabricaci&oacute;n de los elementos constitutivos y el armado de la vivienda, constituyen un solo objeto contractual &uacute;nico e inescindible. La descripci&oacute;n de los elementos constitutivos se se&ntilde;alan en el ANEXO III del presente contrato, formando parte del mismo.<br /><u>El armado de la vivienda no incluye la base o platea sobre la que se plantar&aacute; la misma, siendo la ejecuci&oacute;n de la misma por cuenta y costo de EL/LA LOCATARIO/A.</u><br />En tal sentido EL/LA LOCATARIO/A se obliga a la realizaci&oacute;n de la base, con materiales adecuados y suficientes, que permitan el armado de la vivienda sobre la mencionada platea, todo ello conforme al ANEXO IV del presente contrato, siendo los datos y dem&aacute;s condiciones del terreno responsabilidad exclusiva de EL/LA LOCATARIO/A y no sujetos a verificaci&oacute;n por parte de LA LOCADORA.<br />Asimismo queda bajo responsabilidad de LA LOCATARIA la realizaci&oacute;n de la carpeta interior de la vivienda que permite la fijaci&oacute;n de las paredes impidiendo que las mismas sufran roturas o desplazamientos y ello, en un plazo de 24 horas a partir de la fecha de armado de los elementos constitutivos, objeto de este contrato.</p><p style="text-align: justify;"><strong><u>SEGUNDA: </u></strong></p><p style="text-align: justify;">Sin perjuicio de lo establecido en la cl&aacute;usula PRIMERA, EL/LA LOCATARIO/A solicita a LA LOCADORA, la modificaci&oacute;n del modelo se&ntilde;alado conforme lo siguiente:</p><p style="text-align: justify;">solicitud_componentes</p><p style="text-align: justify;">Siendo la misma acorde a sus necesidades habitacionales.LA LOCADORA acepta las modificaciones en la medida que no obliguen al cambio de las condiciones t&eacute;cnicas del ANEXO I antes mencionado y adjunto. EL/LA LOCATARIO/A se obliga a mantener la descripci&oacute;n y constituci&oacute;n del objeto contratado y mantener la misma al momento del armado de la vivienda. Todo ello conforme el ANEXO II que se acompa&ntilde;a al presente.</p><p style="text-align: justify;"><strong><u>TERCERA: </u></strong></p><p style="text-align: justify;">Siendo que LA LOCADORA se hace cargo del armado de la vivienda, en lote o terreno de propiedad de EL/LA LOCATARIO/A o sobre el cual la misma tuviere derecho, el mismo deber&aacute; indicar ubicaci&oacute;n geogr&aacute;fica y acreditar vinculaci&oacute;n con el lugar de posterior armado de la vivienda y medidas del mismo. Estas &uacute;ltimas se agregan en el ANEXO IV, siendo su precisi&oacute;n y justeza de esponsabilidad de EL/LA LOCATARIO/A.LOCATARIO/A.</p><p style="text-align: justify;">LA LOCADORA puede rehusarse a armar la vivienda en el lote se&ntilde;alado por el locatario cuando:</p><ol>	<li style="text-align: justify;">No se acreditare relaci&oacute;n alguna del lote con el signatario del contrato.</li>	<li style="text-align: justify;">Cuando no se hubiere construido la platea o base de apoyo de la que se se&ntilde;ala en el anexo IV cl&aacute;usula CUARTA del presente, o la misma estuviere ejecutada fuera de las normas de buenas pr&aacute;cticas de construcci&oacute;n, y/o dicha platea se encontrare fuera de la indicaci&oacute;n f&iacute;sica y/o material que se&ntilde;ala el respectivo anexo</li>	<li style="text-align: justify;">No se encontraren los pagos acordados en el contrato efectivizado al momento del armado, y sin perjuicio de lo dispuesto por la cl&aacute;usula SEXTA del presente contrato.</li></ol><p style="text-align: justify;">Cualquiera de estas conductas de EL/LA LOCATARIO/A provocan el nacimiento de da&ntilde;os y perjuicios a favor de LA LOCADORA, en tanto efectiva incurrencia en gastos de transporte, mano de obra y p&eacute;rdida de chance. Sin perjuicio de lo anterior LA LOCADORA, podr&aacute; proceder al armado de la vivienda, bajo las condiciones especiales que pacte con EL/LA LOCATARIO/A, y a riesgo exclusivo de la misma en los supuestos A. y B.</p><p style="text-align: justify;"><strong><u>CUARTA:</u> PRECIO-FORMA DE PAGO</strong></p><p style="text-align: justify;"><strong><u>Contado:</u></strong></p><p style="text-align: justify;">El precio total del presente contrato es fijado en la suma de solicitud_suma_total, habiendo recibido LA LOCADORA antes de ese acto la suma de solicitud_anticipo, con un saldo pendiente de solicitud_saldo50_menos_anticipo, siendo el presente suficiente recibo y oblig&aacute;ndose al pago del saldo esto es solicitud_saldo50 contra entrega de los elementos constitutivos del objeto presente.</p><p style="text-align: justify;"><strong><u>INTERESES: </u></strong></p><p style="text-align: justify;">La falta de cumplimiento en tiempo y forma de los pagos provocar&aacute; el devengamiento de intereses compensatorios de 2,5% mensual a los que se adicionar&aacute; un 1,5 % en concepto de punitorios, que conforme la condici&oacute;n de mora autom&aacute;tica se adicionar&aacute; al pago que se efect&uacute;e tard&iacute;amente.</p><p style="text-align: justify;"><strong><u>QUINTA:</u> MORA</strong></p><p style="text-align: justify;">Las partes pactan que la mora se producir&aacute; de manera autom&aacute;tica por la falta de cumplimento en legal forma de las condiciones y modalidades de las obligaciones pactadas en el presente contrato no siendo necesaria la interpelaci&oacute;n judicial o extrajudicial alguna para su constituci&oacute;n.</p><p style="text-align: justify;"><strong>REFORMULACION DEL PRECIO DEL CONTRATO.</strong> En supuestos de mora de m&aacute;s de un a&ntilde;o en el pago de cuotas del contrato, y sin perjuicio de lo dispuesto en la cl&aacute;usula CUARTA en relaci&oacute;n al anticipo, LA LOCADORA tendr&aacute; derecho a la reformulaci&oacute;n del saldo del contrato conforme precio al momento de la normalizaci&oacute;n y reconducci&oacute;n del pago o eventual ejecuci&oacute;n y cobro, pudiendo mantener la forma de pago convenida en el contrato, a su solo criterio en el primer supuesto.</p><p style="text-align: justify;"><strong><u>SEXTA:</u> RESCISION</strong></p><p style="text-align: justify;">Sin perjuicio del derecho de rescisi&oacute;n de que ambas partes gozan conforme ley aplicable, se pacta expresamente que <strong><u>LA LOCADORA</u></strong>, tendr&aacute; derecho a rescindir unilateralmente y a su sola voluntad, el presente contrato en los siguientes supuestos:</p><ol>	<li style="text-align: justify;">Falta de pago del saldo de precio.</li>	<li style="text-align: justify;">Haberse producido algunos de los hechos que describe la cl&aacute;usula TERCERA, inciso A) o B)</li></ol><p style="text-align: justify;">En estos supuestos las sumas entregadas ser&aacute;n aplicadas a da&ntilde;os y perjuicios ocasionados a LA LOCADORA en cuanto costos de mano de obra, materiales, p&eacute;rdida de chance y/o cualquier otra que hubiere generado la suscripci&oacute;n del contrato y/o su principio de ejecuci&oacute;n, no teniendo EL/LA LOCATARIO/A derecho a reclamo alguno hasta un 55% del total entregado.<br />En caso de que LA LOCATARIA resuelva unilateralmente el contrato por razones ajenas a LA LOCADORA, esta &uacute;ltima proceder&aacute; a LA DEVOLUCI&Oacute;N de las sumas recibidas hasta un 50 % y conforme modalidad de pago que ambas partes de com&uacute;n acuerdo resuelvan.</p><p style="text-align: justify;"><strong><u>SEPTIMA:</u> ENTREGA DE LOS COMPONENTES- CONDICIONES</strong></p><p style="text-align: justify;">La entrega de los componentes fijados en el ANEXO III, se efectuar&aacute; una vez que fuere pagado el 50% del precio fijado en el presente contrato, as&iacute; como los gastos administrativos del total de la operaci&oacute;n efectuada, el sellado del presente y documentos que genera el mismo. El incumplimiento de estos pagos da derecho a LA LOCADORA de no entregar los componentes ni proceder al armado de la vivienda, objeto del contrato, sin derecho a reclamo por parte de EL/LA LOCATARIO/A al respecto, sin perjuicio de otros que correspondieran conforme el presente y la ley aplicable.<br />LA LOCADORA deber&aacute; entregar los componentes y proceder al armado de la vivienda en un plazo que no podr&aacute; exceder los 30 d&iacute;as h&aacute;biles desde el efectivo pago del 50% del precio del presente.Se deja establecido que en caso de demora en la entrega y/o armado de los componentes fundada en caso fortuito o fuerza mayor, huelga del personal, la falta en plaza de los elementos para la elaboraci&oacute;n de los componentes o cualquier otra causa o hecho imprevisto no imputable a LA LOCADORA que impida a esta &uacute;ltima dar cumplimiento de lo pactado en este contrato no lo har&aacute; responsable de las consecuencias del retardo.<br />La entrega de los componentes no incluye los &aacute;ridos para el armado, los que deber&aacute;n ser aportados por EL/LA LOCATARIO/A, as&iacute; como la mano de obra para la colocaci&oacute;n de ladrillos, salvo pacto expreso con LA LOCADORA.</p><p style="text-align: justify;"><strong><u>OCTAVA:</u> TRASLADO DE LOS COMPONENTES- ARMADO</strong></p><p style="text-align: justify;">Los elementos constitutivos de la vivienda ser&aacute;n entregados al locatario &ldquo;en f&aacute;brica&rdquo; por lo que todos los gastos que irrogue el traslado de los mismos ser&aacute;n a cargo exclusivo de EL/LA LOCATARIO/A. Tambi&eacute;n ser&aacute;n a cargo de EL/LA LOCATARIO/A los gastos de armado de la vivienda, actividad que deber&aacute; ser ejecutada por LA LOCADORA. Los gastos correspondientes a este &uacute;ltimo rubro deber&aacute;n ser pagados en la misma oportunidad de retirar los componentes de la f&aacute;brica. En el supuesto que el EL/LA LOCATARIO/A proceda a retirar de f&aacute;brica los componentes de la vivienda y no abone de la manera estipulada los gastos de armado cesa autom&aacute;ticamente la obligaci&oacute;n de EL LOCADOR de proceder al armado de la vivienda no haci&eacute;ndose responsable de los da&ntilde;os que sufran los componentes luego de ser retirados de f&aacute;brica y los que sufran en el intento de armado por parte EL/LA LOCATARIO/A o de tercera persona contratada por este.</p><p style="text-align: justify;"><strong><u>NOVENA</u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A toma a su exclusivo cargo todo tr&aacute;mite de gesti&oacute;n para la obtenci&oacute;n de los permisos indispensables para la instalaci&oacute;n y/o habilitaci&oacute;n que correspondiera de la vivienda de que se trate, incluyendo sin limitar provisiones de servicios domiciliarios, eximiendo a la locadora toda responsabilidad por los resultados de dichas gestiones. Adem&aacute;s, la locataria asume de manera exclusiva y excluyente la obligaci&oacute;n de pagar los impuestos, gastos administrativos y dem&aacute;s erogaciones que demande la formalizaci&oacute;n de &eacute;ste contrato.</p><p style="text-align: justify;"><strong><u>DECIMA:</u> FIJACION DE DOMICILIO</strong></p><p style="text-align: justify;">Para todos los efectos del presente contrato, las partes fijan domicilio especial en los que respectivamente han denunciado en el encabezado del presente, siendo en dichos lugares eficaces todas las notificaciones y/o intimaciones que se cursen ya sean judiciales o extrajudiciales debiendo quien modifique los mismos hacerlo saber a EL LOCADOR por medio de carta documento y/o telegrama colacionado y/u otro medio fehaciente.</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">En la ciudad de cliente_localidad provincia de cliente_provincia a los contrato_dia d&iacute;as del mes de contrato_mes del a&ntilde;o contrato_anio se firman dos ejemplares de un mismo tener y efecto.</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><p style="text-align: justify;">&nbsp;</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%">	<tbody>		<tr>			<td>			<p style="text-align: justify;">LOCADOR:</p>			</td>			<td>			<p style="text-align: justify;">LOCATARIO:</p>			</td>		</tr>		<tr>			<td style="text-align:justify">..........................................................................</td>			<td style="text-align:justify">..........................................................................</td>		</tr>		<tr>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>		</tr>		<tr>			<td>			<p style="text-align: justify;">..........................................................................</p>			</td>			<td style="text-align:justify">..........................................................................</td>		</tr>	</tbody></table>', '2019-01-08 23:05:01', '2019-01-09 22:33:57'),
