lote o terreno de propiedad de EL/LA LOCATARIO/A o sobre el cual la misma tuviere derecho, el mismo deber&aacute; indicar ubicaci&oacute;n geogr&aacute;fica y acreditar vinculaci&oacute;n con el lugar de posterior armado de la vivienda y medidas del mismo. Estas &uacute;ltimas se agregan en el ANEXO IV, siendo su precisi&oacute;n y justeza de esponsabilidad de EL/LA LOCATARIO/A.LOCATARIO/A.</p><p style="text-align: justify;">LA LOCADORA puede rehusarse a armar la vivienda en el lote se&ntilde;alado por el locatario cuando:</p><ol>	<li style="text-align: justify;">No se acreditare relaci&oacute;n alguna del lote con el signatario del contrato.</li>	<li style="text-align: justify;">Cuando no se hubiere construido la platea o base de apoyo de la que se se&ntilde;ala en el anexo IV cl&aacute;usula CUARTA del presente, o la misma estuviere ejecutada fuera de las normas de buenas pr&aacute;cticas de construcci&oacute;n, y/o dicha platea se encontrare fuera de la indicaci&oacute;n f&iacute;sica y/o material que se&ntilde;ala el respectivo anexo</li>	<li style="text-align: justify;">No se encontraren los pagos acordados en el contrato efectivizado al momento del armado, y sin perjuicio de lo dispuesto por la cl&aacute;usula SEXTA del presente contrato.</li></ol><p style="text-align: justify;">Cualquiera de estas conductas de EL/LA LOCATARIO/A provocan el nacimiento de da&ntilde;os y perjuicios a favor de LA LOCADORA, en tanto efectiva incurrencia en gastos de transporte, mano de obra y p&eacute;rdida de chance. Sin perjuicio de lo anterior LA LOCADORA, podr&aacute; proceder al armado de la vivienda, bajo las condiciones especiales que pacte con EL/LA LOCATARIO/A, y a riesgo exclusivo de la misma en los supuestos A. y B.</p><p style="text-align: justify;"><strong><u>CUARTA:</u> PRECIO-FORMA DE PAGO</strong></p><p style="text-align: justify;"><strong><u>Anticipo + Cuotas:</u></strong></p><p style="text-align: justify;">El precio total del presente contrato es fijado en la suma de solicitud_suma_total, cantidad que EL/LA LOCATARIO/A se obliga a abonar de la siguiente forma: anticipo de solicitud_anticipo, habiendo recibido LA LOCADORA antes de este acto la suma de .........monto_pagado.......... que se imputan al anticipo fijado, el resto del anticipo EL/LA LOCATARIO/A se obliga a pagarlo en solicitud_cuotas_anticipo cuotas de solicitud_monto_cuotas_anticipo. El saldo del precio se obliga EL/LA LOCATARIO/A a cancelarlo de la siguiente forma, solicitud_cuotas_contrato cuotas iguales y consecutivas de solicitud_monto_cuotas_contrato cada una, operando el vencimiento de la primera de ellas a los 30 d&iacute;as de saldado el anticipo, siendo el vencimiento de las restantes el mismo d&iacute;a de los meses subsiguientes. En ning&uacute;n caso el plazo para la cancelaci&oacute;n del anticipo ser&aacute; superior a un a&ntilde;o, salvo acuerdo de partes. Sin perjuicio de lo anterior y en caso de que el pago del anticipo se efect&uacute;e en per&iacute;odo superior a un a&ntilde;o, a solo criterio de LA LOCADORA esta podr&aacute; reformular el valor del saldo del contrato conforme precio al momento de la finalizaci&oacute;n del pago, o rescindir el contrato, devolviendo hasta el 50% del valor entregado por LA LOCATARIA.</p><p style="text-align: justify;">Lugar de pago: Las cuotas ser&aacute;n abonadas entre el 1 y 10 d&iacute;as del mes que corresponda a cada una de ellas en sucursal_domicilio, sucursal_localidad.</p><p style="text-align: justify;"><strong><u>INTERESES:</u></strong></p><p style="text-align: justify;">La falta de cumplimiento en tiempo y forma de los pagos provocar&aacute; el devengamiento de intereses compensatorios de 2,5% mensual a los que se adicionar&aacute; un 1,5 % en concepto de punitorios, que conforme la condici&oacute;n de mora autom&aacute;tica se adicionar&aacute; al pago que se efect&uacute;e tard&iacute;amente. En el caso que sea exigible la totalidad del saldo deudor como consecuencia de la caducidad de los plazos, los intereses fijados m&aacute;s arriba se devengar&aacute;n a partir de la notificaci&oacute;n fehaciente a EL/LA LOCATARIO/A de la voluntad de LA LOCADORA de dar por caduco todo plazo acordado.</p><p style="text-align: justify;"><strong><u>QUINTA:</u> MORA</strong></p><p style="text-align: justify;">Las partes pactan que la mora se producir&aacute; de manera autom&aacute;tica por la falta de cumplimento en legal forma de las condiciones y modalidades de las obligaciones pactadas en el presente contrato no siendo necesaria la interpelaci&oacute;n judicial o extrajudicial alguna para su constituci&oacute;n.</p><p style="text-align: justify;"><strong>REFORMULACION DEL PRECIO DEL CONTRATO.</strong> En supuestos de mora de m&aacute;s de un a&ntilde;o en el pago de cuotas del contrato, y sin perjuicio de lo dispuesto en la cl&aacute;usula CUARTA en relaci&oacute;n al anticipo, LA LOCADORA tendr&aacute; derecho a la reformulaci&oacute;n del saldo del contrato conforme precio al momento de la normalizaci&oacute;n y reconducci&oacute;n del pago o eventual ejecuci&oacute;n y cobro, pudiendo mantener la forma de pago convenida en el contrato, a su solo criterio en el primer supuesto.</p><p style="text-align: justify;"><strong><u>SEXTA:</u> RESCISION</strong></p><p style="text-align: justify;">Sin perjuicio del derecho de rescisi&oacute;n de que ambas partes gozan conforme ley aplicable, se pacta expresamente que <strong><u>LA LOCADORA</u></strong>, tendr&aacute; derecho a rescindir unilateralmente y a su sola voluntad, el presente contrato en los siguientes supuestos:</p><ol>	<li style="text-align: justify;">Falta de pago de suma alguna de anticipo.</li>	<li style="text-align: justify;">Falta de pago de dos cuotas seguidas o cinco alternadas del anticipo.</li>	<li style="text-align: justify;">Falta de pago de cuotas del contrato, a&uacute;n en el caso que el anticipo hubiere sido pagado, en cuando el mismo no fuere igual o superior al 40 % del total del precio.</li>	<li style="text-align: justify;">Haberse producido algunos de los hechos que describe la cl&aacute;usula TERCERA, inciso A) o B)</li>	<li style="text-align: justify;">Falta de constituci&oacute;n en tiempo y forma de la garant&iacute;a de pago del presente contrato.</li></ol><p style="text-align: justify;">En estos supuestos las sumas entregadas ser&aacute;n aplicadas a da&ntilde;os y perjuicios ocasionados a LA LOCADORA en cuanto costos de mano de obra, materiales, p&eacute;rdida de chance y/o cualquier otra que hubiere generado la suscripci&oacute;n del contrato y/o su principio de ejecuci&oacute;n, no teniendo EL/LA LOCATARIO/A derecho a reclamo alguno.<br />En caso de que LA LOCATARIA resuelva unilateralmente el contrato por razones ajenas a LA LOCADORA, esta &uacute;ltima proceder&aacute; a LA DEVOLUCI&Oacute;N de las sumas recibidas hasta un 50 % y conforme modalidad de pago que ambas partes de com&uacute;n acuerdo resuelvan.</p><p style="text-align: justify;"><strong><u>SEPTIMA:</u> CADUCIDAD DE LOS PLAZOS</strong></p><p style="text-align: justify;">Sin perjuicio del derecho rescisorio que pudiere ejercer LA LOCADORA, conforme la cl&aacute;usula sexta, las partes pactan que la falta de pago dentro del plazo estipulado de dos cuotas del saldo del precio ya sean estas alternadas o consecutivas, dar&aacute; derecho a LA LOCADORA, a dar por caducos todos los plazos acordados para el pago de precio pactado, haci&eacute;ndose exigible el saldo del precio en su totalidad y desde el momento de producirse la mora.<br />La voluntad de dar por caduco los plazos deber&aacute; ser notificada por LA LOCADORA por medio fehaciente y acordando un plazo no menor de 15 d&iacute;as para que EL/LA LOCATARIO/A pueda dar cumplimiento al pago de la totalidad del saldo requerido.<br />La tolerancia de LA LOCADORA no ser&aacute; interpretada como una renuncia al ejercicio del presente derecho, en cualquier momento del desarrollo del contrato, y a&uacute;n en el caso de incumplimiento anteriores no afectados por la mencionada caducidad de plazos.</p><p style="text-align: justify;"><strong><u>OCTAVA:</u> ENTREGA DE LOS COMPONENTES- CONDICIONES</strong></p><p style="text-align: justify;">La entrega de los componentes fijados en el ANEXO III, se efectuar&aacute; una vez que fuere pagado el anticipo fijado en el presente contrato, as&iacute; como los gastos administrativos del total de la operacion efectuada (3% del valor del contrato), el sellado del presente y documentos que genera el mismo. La mora en el pago del anticipo o en su caso la existencia de cuotas pendientes da el derecho a LA LOCADORA de no entregar los componentes ni proceder al armado de la vivienda, objeto del contrato, sin derecho a reclamo por parte de EL/LA LOCATARIO/A al respecto. LA LOCADORA deber&aacute; entregar los componentes y proceder al armado de la vivienda en un plazo que no podr&aacute; exceder los 90 d&iacute;as h&aacute;biles desde la constituci&oacute;n de las garant&iacute;as que fija la cl&aacute;usula DECIMO PRIMERA, as&iacute; como del pago total del anticipo.<br />Se deja establecido que en caso de demora en la entrega y/o armado de los componentes fundada en caso fortuito o fuerza mayor, huelga del personal, la falta en plaza de los elementos para la elaboraci&oacute;n de los componentes o cualquier otra causa o hecho imprevisto no imputable a LA LOCADORA que impida a esta &uacute;ltima dar cumplimiento de lo pactado en este contrato no lo har&aacute; responsable de las consecuencias del retardo.<br />La entrega de los componentes no incluye los &aacute;ridos para el armado, los que deber&aacute;n ser aportados por EL/LA LOCATARIO/A, as&iacute; como la mano de obra para la colocaci&oacute;n de ladrillos, salvo pacto expreso con LA LOCADORA.</p><p style="text-align: justify;"><strong><u>NOVENA</u> TRASLADO DE LOS COMPONENTES- ARMADO</strong></p><p style="text-align: justify;">Los elementos constitutivos de la vivienda ser&aacute;n entregados al locatario &ldquo;en f&aacute;brica&rdquo; por lo que todos los gastos que irrogue el traslado de los mismos ser&aacute;n a cargo exclusivo de EL/LA LOCATARIO/A. Tambi&eacute;n ser&aacute;n a cargo de la EL/LA LOCATARIO/A los gastos de armado de la vivienda, actividad que deber&aacute; ser ejecutada por el locador. Los gastos correspondientes a este &uacute;ltimo rubro deber&aacute;n ser pagados en la misma oportunidad de retirar los componentes de la f&aacute;brica. En el supuesto que el locatario proceda a retirar de f&aacute;brica los componentes de la vivienda y no abone de la manera estipulada los gastos de armado cesa autom&aacute;ticamente la obligaci&oacute;n del locador de proceder al armado de la vivienda no haci&eacute;ndose responsable de los da&ntilde;os que sufran los componentes luego de ser retirados de f&aacute;brica y los que sufran en el intento de armado por parte del locatario o de tercera persona contratada por este.</p><p style="text-align: justify;"><strong><u>DECIMA:</u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A toma a su exclusivo cargo todo tr&aacute;mite de gesti&oacute;n para la obtenci&oacute;n de los permisos indispensables para la instalaci&oacute;n y/o habilitaci&oacute;n que correspondiera de la vivienda de que se trate, incluyendo sin limitar provisiones de servicios domiciliarios, eximiendo a la locadora toda responsabilidad por los resultados de dichas gestiones. Adem&aacute;s, la locataria asume de manera exclusiva y excluyente la obligaci&oacute;n de pagar los impuestos, gastos administrativos y dem&aacute;s erogaciones que demande la formalizaci&oacute;n de &eacute;ste contrato.</p><p style="text-align: justify;"><strong><u>DECIMO PRIMERA:</u></strong></p><p style="text-align: justify;">Cumplido el pago del anticipo por parte de LA LOCATARIA para el posterior armado y antes del mismo LA LOCATARIA se obliga a aportar a EL LOCADOR, conforme anexo V, las garant&iacute;as reales y/o personales a satisfacci&oacute;n de este &uacute;ltimo, que se constituyan en LISO, LLANO, PRINCIPAL PAGADOR de todas las obligaciones de este contrato y sus anexos, de forma inmediata y en un plazo no superior a quince d&iacute;as h&aacute;biles desde la cancelaci&oacute;n del anticipo.<br />La falta de cumplimiento por parte de LA LOCATARIA de esta cl&aacute;usula otorga a EL/LA LOCATARIO/A el derecho de rescindir, a su solo criterio, el presente contrato sin derecho a reclamo alguno por parte de EL/LA LOCATARIO/A, quedando las sumas entregadas hasta la fecha aplicadas a costos, gastos administrativos y da&ntilde;os y perjuicios ocasionados, sin perjuicio de exigir mayores sumas por tales conceptos en la medida que correspondieren.<br />EL/LA LOCATARIO/A se obliga a reemplazar al Fiador presentado en caso de devenir el mismo desempleado o insolvente, proponiendo una nueva FIANZA, bajo apercibimiento de rescisi&oacute;n.LA LOCADORA podr&aacute; solicitar de tanto en tanto, y de acuerdo a su criterio documentaci&oacute;n que permita corroborar la vigencia de solvencia del fiador propuesto.</p><p style="text-align: justify;"><strong><u>DECIMO SEGUNDA:</u> FIJACION DE DOMICILIO</strong></p><p style="text-align: justify;">Para todos los efectos del presente contrato, las partes fijan domicilio especial en los que respectivamente han denunciado en el encabezado del presente, siendo en dichos lugares eficaces todas las notificaciones y/o intimaciones que se cursen ya sean judiciales o extrajudiciales debiendo quien modifique los mismos hacerlo saber a EL LOCADOR por medio de carta documento y/o telegrama colacionado y/u otro medio fehaciente.</p><p style="text-align: justify;">En la ciudad de cliente_localidad provincia de cliente_provincia a los contrato_dia d&iacute;as del mes de contrato_mes del a&ntilde;o contrato_anio se firman dos ejemplares de un mismo tener y efecto.</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%">	<tbody>		<tr>			<td>			<p style="text-align: justify;">LOCADOR:</p>			</td>			<td>			<p style="text-align: justify;">LOCATARIO:</p>			</td>		</tr>		<tr>			<td style="text-align:justify">..........................................................................</td>			<td style="text-align:justify">..........................................................................</td>		</tr>		<tr>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>		</tr>		<tr>			<td>			<p style="text-align: justify;">..........................................................................</p>			</td>			<td style="text-align:justify">..........................................................................</td>		</tr>	</tbody></table>', '2019-01-08 23:05:19', '2019-01-09 22:31:37');
INSERT INTO `reportes` (`id`, `empresa_id`, `nombre_de_reporte`, `rtf_cuerpo`, `created_at`, `updated_at`) VALUES
(5, 1, 'Contrato  Contado Diferido', '<p style="text-align: justify;">Entre <strong>Viviendas TecnoHouse de Sistemas de Viviendas Tecnohogar S.R.L.</strong>, con domicilio en calle <strong>Marcos Ciani 3305</strong> de la ciudad de <strong>Venado Tuerto</strong>, provincia de <strong>Santa Fe</strong>, por una parte y en adelante llamada LA LOCADORA y el/la <strong>Sr./Sra.</strong> cliente_nombre cliente_apellido titular del cliente_tipo_de_documento cliente_nro_de_documento con domicilio real en cliente_domicilio de la ciudad de cliente_localidad, provincia de cliente_provincia por otra parte y, en adelante llamada EL/LA LOCATARIO/A, se conviene la celebraci&oacute;n del presente contrato, el que se regir&aacute; por lo dispuesto por las cl&aacute;usulas y supletoriamente por lo dispuesto en el C&oacute;digo Civil en lo que fuera pertinente.</p><p style="text-align: justify;"><strong><u>PRIMERA: </u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A solicita a LA LOCADORA :</p><ol>	<li style="text-align: justify;">La fabricaci&oacute;n de elementos constitutivos de una vivienda MODELO solicitud_modelo / solicitud_total_de_metros_cuadrados mts2 INTERNOS, de solicitud_total_de_metros_cuadrados m2 de superficie cubierta, medidas interiores en metros y conforme las condiciones t&eacute;cnicas que se se&ntilde;alan en el ANEXO I, que forma parte integrante del presente contrato.</li>	<li style="text-align: justify;">El armado de la vivienda a que se refiere el punto A.</li></ol><p style="text-align: justify;">El presente contrato no involucra una vivienda llave en mano, encontr&aacute;ndose sujeto a las condiciones particulares de cada caso.<br /><strong><u>LA LOCADORA</u></strong> se obliga al cumplimiento del objeto solicitado, fijando ambas partes que la fabricaci&oacute;n de los elementos constitutivos y el armado de la vivienda, constituyen un solo objeto contractual &uacute;nico e inescindible. La descripci&oacute;n de los elementos constitutivos se se&ntilde;alan en el ANEXO III del presente contrato, formando parte del mismo.<br /><u>El armado de la vivienda no incluye la base o platea sobre la que se plantar&aacute; la misma, siendo la ejecuci&oacute;n de la misma por cuenta y costo de EL/LA LOCATARIO/A.</u><br />En tal sentido EL/LA LOCATARIO/A se obliga a la realizaci&oacute;n de la base, con materiales adecuados y suficientes, que permitan el armado de la vivienda sobre la mencionada platea, todo ello conforme al ANEXO IV del presente contrato, siendo los datos y dem&aacute;s condiciones del terreno responsabilidad exclusiva de EL/LA LOCATARIO/A y no sujetos a verificaci&oacute;n por parte de LA LOCADORA.<br />Asimismo queda bajo responsabilidad de LA LOCATARIA la realizaci&oacute;n de la carpeta interior de la vivienda que permite la fijaci&oacute;n de las paredes impidiendo que las mismas sufran roturas o desplazamientos y ello, en un plazo de 24 horas a partir de la fecha de armado de los elementos constitutivos, objeto de este contrato.</p><p style="text-align: justify;"><strong><u>SEGUNDA: </u></strong></p><p style="text-align: justify;">Sin perjuicio de lo establecido en la cl&aacute;usula PRIMERA, EL/LA LOCATARIO/A solicita a LA LOCADORA, la modificaci&oacute;n del modelo se&ntilde;alado conforme lo siguiente:</p><p style="text-align: justify;">solicitud_componentes</p><p style="text-align: justify;">Siendo la misma acorde a sus necesidades habitacionales.LA LOCADORA acepta las modificaciones en la medida que no obliguen al cambio de las condiciones t&eacute;cnicas del ANEXO I antes mencionado y adjunto. EL/LA LOCATARIO/A se obliga a mantener la descripci&oacute;n y constituci&oacute;n del objeto contratado y mantener la misma al momento del armado de la vivienda. Todo ello conforme el ANEXO II que se acompa&ntilde;a al presente.</p><p style="text-align: justify;"><strong><u>TERCERA: </u></strong></p><p style="text-align: justify;">Siendo que LA LOCADORA se hace cargo del armado de la vivienda, en lote o terreno de propiedad de EL/LA LOCATARIO/A o sobre el cual la misma tuviere derecho, el mismo deber&aacute; indicar ubicaci&oacute;n geogr&aacute;fica y acreditar vinculaci&oacute;n con el lugar de posterior armado de la vivienda y medidas del mismo. Estas &uacute;ltimas se agregan en el ANEXO IV, siendo su precisi&oacute;n y justeza de esponsabilidad de EL/LA LOCATARIO/A.LOCATARIO/A.</p><p style="text-align: justify;">LA LOCADORA puede rehusarse a armar la vivienda en el lote se&ntilde;alado por el locatario cuando:</p><ol>	<li style="text-align: justify;">No se acreditare relaci&oacute;n alguna del lote con el signatario del contrato.</li>	<li style="text-align: justify;">Cuando no se hubiere construido la platea o base de apoyo de la que se se&ntilde;ala en el anexo IV cl&aacute;usula CUARTA del presente, o la misma estuviere ejecutada fuera de las normas de buenas pr&aacute;cticas de construcci&oacute;n, y/o dicha platea se encontrare fuera de la indicaci&oacute;n f&iacute;sica y/o material que se&ntilde;ala el respectivo anexo</li>	<li style="text-align: justify;">No se encontraren los pagos acordados en el contrato efectivizado al momento del armado, y sin perjuicio de lo dispuesto por la cl&aacute;usula SEXTA del presente contrato.</li></ol><p style="text-align: justify;">Cualquiera de estas conductas de EL/LA LOCATARIO/A provocan el nacimiento de da&ntilde;os y perjuicios a favor de LA LOCADORA, en tanto efectiva incurrencia en gastos de transporte, mano de obra y p&eacute;rdida de chance. Sin perjuicio de lo anterior LA LOCADORA, podr&aacute; proceder al armado de la vivienda, bajo las condiciones especiales que pacte con EL/LA LOCATARIO/A, y a riesgo exclusivo de la misma en los supuestos A. y B.</p><p style="text-align: justify;"><strong><u>CUARTA:</u> PRECIO-FORMA DE PAGO</strong></p><p style="text-align: justify;"><strong><u>Contado Diferido:</u></strong></p><p style="text-align: justify;">El precio total del presente contrato es fijado en la suma de solicitud_suma_total, cantidad que EL/LA LOCATARIO/A se obliga a abonar de la siguiente forma: anticipo de solicitud_anticipo, habiendo recibido LA LOCADORA antes de este acto la suma de .........monto_pagado.......... que se imputan al anticipo fijado, el resto del anticipo EL/LA LOCATARIO/A se obliga a pagarlo en solicitud_cuotas_anticipo cuotas de solicitud_monto_cuotas_anticipo. El saldo del precio se obliga EL/LA LOCATARIO/A a cancelarlo de la siguiente forma, solicitud_cuotas_contrato cuotas iguales y consecutivas de solicitud_monto_cuotas_contrato, abonando la primer cuota a los 30 d&iacute;as de haber saldado el anticipo fijado, siendo el vencimiento de las restantes el mismo d&iacute;a de los meses subsiguientes. En ning&uacute;n caso el plazo para la cancelaci&oacute;n del anticipo ser&aacute; superior a un a&ntilde;o, salvo acuerdo partes. Sin perjuicio de lo anterior y en caso de que el pago del anticipo se efect&uacute;e en per&iacute;odo superior a un a&ntilde;o, a solo criterio de LA LOCADORA esta podr&aacute; reformular el valor del saldo del contrato conforme precio al momento de la finalizaci&oacute;n del pago, o rescindir el contrato, devolviendo hasta el 50 % del valor entregado por LA LOCATARIA.</p><p style="text-align: justify;">Lugar de pago: Las cuotas ser&aacute;n abonadas entre el 1 y 10 d&iacute;as del mes que corresponda a cada una de ellas en sucursal_domicilio, sucursal_localidad.</p><p style="text-align: justify;"><strong><u>INTERESES:</u></strong></p><p style="text-align: justify;">La falta de cumplimiento en tiempo y forma de los pagos provocar&aacute; el devengamiento de intereses compensatorios de 2,5% mensual a los que se adicionar&aacute; un 1,5 % en concepto de punitorios, que conforme la condici&oacute;n de mora autom&aacute;tica se adicionar&aacute; al pago que se efect&uacute;e tard&iacute;amente. En el caso que sea exigible la totalidad del saldo deudor como consecuencia de la caducidad de los plazos, los intereses fijados m&aacute;s arriba se devengar&aacute;n a partir de la notificaci&oacute;n fehaciente a EL/LA LOCATARIO/A de la voluntad de LA LOCADORA de dar por caduco todo plazo acordado.</p><p style="text-align: justify;"><strong><u>QUINTA:</u> MORA</strong></p><p style="text-align: justify;">Las partes pactan que la mora se producir&aacute; de manera autom&aacute;tica por la falta de cumplimento en legal forma de las condiciones y modalidades de las obligaciones pactadas en el presente contrato no siendo necesaria la interpelaci&oacute;n judicial o extrajudicial alguna para su constituci&oacute;n.</p><p style="text-align: justify;"><strong>REFORMULACION DEL PRECIO DEL CONTRATO.</strong> En supuestos de mora de m&aacute;s de un a&ntilde;o en el pago de cuotas del contrato, y sin perjuicio de lo dispuesto en la cl&aacute;usula CUARTA en relaci&oacute;n al anticipo, LA LOCADORA tendr&aacute; derecho a la reformulaci&oacute;n del saldo del contrato conforme precio al momento de la normalizaci&oacute;n y reconducci&oacute;n del pago o eventual ejecuci&oacute;n y cobro, pudiendo mantener la forma de pago convenida en el contrato, a su solo criterio en el primer supuesto.</p><p style="text-align: justify;"><strong><u>SEXTA:</u> RESCISION</strong></p><p style="text-align: justify;">Sin perjuicio del derecho de rescisi&oacute;n de que ambas partes gozan conforme ley aplicable, se pacta expresamente que <strong><u>LA LOCADORA</u></strong>, tendr&aacute; derecho a rescindir unilateralmente y a su sola voluntad, el presente contrato en los siguientes supuestos:</p><ol>	<li style="text-align: justify;">Falta de pago de suma alguna de anticipo.</li>	<li style="text-align: justify;">Falta de pago de dos cuotas seguidas o cinco alternadas del anticipo.</li>	<li style="text-align: justify;">Falta de pago de cuotas del contrato, a&uacute;n en el caso que el anticipo hubiere sido pagado, en cuando el mismo no fuere igual o superior al 40 % del total del precio.</li>	<li style="text-align: justify;">Haberse producido algunos de los hechos que describe la cl&aacute;usula TERCERA, inciso A) o B)</li>	<li style="text-align: justify;">Falta de constituci&oacute;n en tiempo y forma de la garant&iacute;a de pago del presente contrato.</li></ol><p style="text-align: justify;">En estos supuestos las sumas entregadas ser&aacute;n aplicadas a da&ntilde;os y perjuicios ocasionados a LA LOCADORA en cuanto costos de mano de obra, materiales, p&eacute;rdida de chance y/o cualquier otra que hubiere generado la suscripci&oacute;n del contrato y/o su principio de ejecuci&oacute;n, no teniendo EL/LA LOCATARIO/A derecho a reclamo alguno.<br />En caso de que LA LOCATARIA resuelva unilateralmente el contrato por razones ajenas a LA LOCADORA, esta &uacute;ltima proceder&aacute; a LA DEVOLUCI&Oacute;N de las sumas recibidas hasta un 50 % y conforme modalidad de pago que ambas partes de com&uacute;n acuerdo resuelvan.</p><p style="text-align: justify;"><strong><u>SEPTIMA:</u> CADUCIDAD DE LOS PLAZOS</strong></p><p style="text-align: justify;">Sin perjuicio del derecho rescisorio que pudiere ejercer LA LOCADORA, conforme la cl&aacute;usula sexta, las partes pactan que la falta de pago dentro del plazo estipulado de dos cuotas del saldo del precio ya sean estas alternadas o consecutivas, dar&aacute; derecho a LA LOCADORA, a dar por caducos todos los plazos acordados para el pago de precio pactado, haci&eacute;ndose exigible el saldo del precio en su totalidad y desde el momento de producirse la mora.<br />La voluntad de dar por caduco los plazos deber&aacute; ser notificada por LA LOCADORA por medio fehaciente y acordando un plazo no menor de 15 d&iacute;as para que EL/LA LOCATARIO/A pueda dar cumplimiento al pago de la totalidad del saldo requerido.<br />La tolerancia de LA LOCADORA no ser&aacute; interpretada como una renuncia al ejercicio del presente derecho, en cualquier momento del desarrollo del contrato, y a&uacute;n en el caso de incumplimiento anteriores no afectados por la mencionada caducidad de plazos.</p><p style="text-align: justify;"><strong><u>OCTAVA:</u> ENTREGA DE LOS COMPONENTES- CONDICIONES</strong></p><p style="text-align: justify;">La entrega de los componentes fijados en el ANEXO III, se efectuar&aacute; una vez que fuere pagado el anticipo fijado en el presente contrato, as&iacute; como los gastos administrativos del total de la operacion efectuada (3% del valor del contrato), el sellado del presente y documentos que genera el mismo. La mora en el pago del anticipo o en su caso la existencia de cuotas pendientes da el derecho a LA LOCADORA de no entregar los componentes ni proceder al armado de la vivienda, objeto del contrato, sin derecho a reclamo por parte de EL/LA LOCATARIO/A al respecto. LA LOCADORA deber&aacute; entregar los componentes y proceder al armado de la vivienda en un plazo que no podr&aacute; exceder los 90 d&iacute;as h&aacute;biles desde la constituci&oacute;n de las garant&iacute;as que fija la cl&aacute;usula DECIMO PRIMERA, as&iacute; como del pago total del anticipo.<br />Se deja establecido que en caso de demora en la entrega y/o armado de los componentes fundada en caso fortuito o fuerza mayor, huelga del personal, la falta en plaza de los elementos para la elaboraci&oacute;n de los componentes o cualquier otra causa o hecho imprevisto no imputable a LA LOCADORA que impida a esta &uacute;ltima dar cumplimiento de lo pactado en este contrato no lo har&aacute; responsable de las consecuencias del retardo.<br />La entrega de los componentes no incluye los &aacute;ridos para el armado, los que deber&aacute;n ser aportados por EL/LA LOCATARIO/A, as&iacute; como la mano de obra para la colocaci&oacute;n de ladrillos, salvo pacto expreso con LA LOCADORA.</p><p style="text-align: justify;"><strong><u>NOVENA</u> TRASLADO DE LOS COMPONENTES- ARMADO</strong></p><p style="text-align: justify;">Los elementos constitutivos de la vivienda ser&aacute;n entregados al locatario &ldquo;en f&aacute;brica&rdquo; por lo que todos los gastos que irrogue el traslado de los mismos ser&aacute;n a cargo exclusivo de EL/LA LOCATARIO/A. Tambi&eacute;n ser&aacute;n a cargo de la EL/LA LOCATARIO/A los gastos de armado de la vivienda, actividad que deber&aacute; ser ejecutada por el locador. Los gastos correspondientes a este &uacute;ltimo rubro deber&aacute;n ser pagados en la misma oportunidad de retirar los componentes de la f&aacute;brica. En el supuesto que el locatario proceda a retirar de f&aacute;brica los componentes de la vivienda y no abone de la manera estipulada los gastos de armado cesa autom&aacute;ticamente la obligaci&oacute;n del locador de proceder al armado de la vivienda no haci&eacute;ndose responsable de los da&ntilde;os que sufran los componentes luego de ser retirados de f&aacute;brica y los que sufran en el intento de armado por parte del locatario o de tercera persona contratada por este.</p><p style="text-align: justify;"><strong><u>DECIMA:</u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A toma a su exclusivo cargo todo tr&aacute;mite de gesti&oacute;n para la obtenci&oacute;n de los permisos indispensables para la instalaci&oacute;n y/o habilitaci&oacute;n que correspondiera de la vivienda de que se trate, incluyendo sin limitar provisiones de servicios domiciliarios, eximiendo a la locadora toda responsabilidad por los resultados de dichas gestiones. Adem&aacute;s, la locataria asume de manera exclusiva y excluyente la obligaci&oacute;n de pagar los impuestos, gastos administrativos y dem&aacute;s erogaciones que demande la formalizaci&oacute;n de &eacute;ste contrato.</p><p style="text-align: justify;"><strong><u>DECIMO PRIMERA:</u></strong></p><p style="text-align: justify;">Cumplido el pago del anticipo por parte de LA LOCATARIA para el posterior armado y antes del mismo LA LOCATARIA se obliga a aportar a EL LOCADOR, conforme anexo V, las garant&iacute;as reales y/o personales a satisfacci&oacute;n de este &uacute;ltimo, que se constituyan en LISO, LLANO, PRINCIPAL PAGADOR de todas las obligaciones de este contrato y sus anexos, de forma inmediata y en un plazo no superior a quince d&iacute;as h&aacute;biles desde la cancelaci&oacute;n del anticipo.<br />La falta de cumplimiento por parte de LA LOCATARIA de esta cl&aacute;usula otorga a EL/LA LOCATARIO/A el derecho de rescindir, a su solo criterio, el presente contrato sin derecho a reclamo alguno por parte de EL/LA LOCATARIO/A, quedando las sumas entregadas hasta la fecha aplicadas a costos, gastos administrativos y da&ntilde;os y perjuicios ocasionados, sin perjuicio de exigir mayores sumas por tales conceptos en la medida que correspondieren.<br />EL/LA LOCATARIO/A se obliga a reemplazar al Fiador presentado en caso de devenir el mismo desempleado o insolvente, proponiendo una nueva FIANZA, bajo apercibimiento de rescisi&oacute;n.LA LOCADORA podr&aacute; solicitar de tanto en tanto, y de acuerdo a su criterio documentaci&oacute;n que permita corroborar la vigencia de solvencia del fiador propuesto.</p><p style="text-align: justify;"><strong><u>DECIMO SEGUNDA:</u> FIJACION DE DOMICILIO</strong></p><p style="text-align: justify;">Para todos los efectos del presente contrato, las partes fijan domicilio especial en los que respectivamente han denunciado en el encabezado del presente, siendo en dichos lugares eficaces todas las notificaciones y/o intimaciones que se cursen ya sean judiciales o extrajudiciales debiendo quien modifique los mismos hacerlo saber a EL LOCADOR por medio de carta documento y/o telegrama colacionado y/u otro medio fehaciente.</p><p style="text-align: justify;">En la ciudad de cliente_localidad provincia de cliente_provincia a los contrato_dia d&iacute;as del mes de contrato_mes del a&ntilde;o contrato_anio se firman dos ejemplares de un mismo tener y efecto.</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%">	<tbody>		<tr>			<td>			<p style="text-align: justify;">LOCADOR:</p>			</td>			<td>			<p style="text-align: justify;">LOCATARIO:</p>			</td>		</tr>		<tr>			<td style="text-align:justify">..........................................................................</td>			<td style="text-align:justify">..........................................................................</td>		</tr>		<tr>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>		</tr>		<tr>			<td>			<p style="text-align: justify;">..........................................................................</p>			</td>			<td style="text-align:justify">..........................................................................</td>		</tr>	</tbody></table>', '2019-01-08 23:05:42', '2019-01-09 22:34:54'),
(6, 1, 'Contrato  Todo Financiado', '<p style="text-align: justify;">Entre <strong>Viviendas TecnoHouse de Sistemas de Viviendas Tecnohogar S.R.L.</strong>, con domicilio en calle <strong>Marcos Ciani 3305</strong> de la ciudad de <strong>Venado Tuerto</strong>, provincia de <strong>Santa Fe</strong>, por una parte y en adelante llamada LA LOCADORA y el/la <strong>Sr./Sra.</strong> cliente_nombre cliente_apellido titular del cliente_tipo_de_documento cliente_nro_de_documento con domicilio real en cliente_domicilio de la ciudad de cliente_localidad, provincia de cliente_provincia por otra parte y, en adelante llamada EL/LA LOCATARIO/A, se conviene la celebraci&oacute;n del presente contrato, el que se regir&aacute; por lo dispuesto por las cl&aacute;usulas y supletoriamente por lo dispuesto en el C&oacute;digo Civil en lo que fuera pertinente.</p><p style="text-align: justify;"><strong><u>PRIMERA: </u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A solicita a LA LOCADORA :</p><ol>	<li style="text-align: justify;">La fabricaci&oacute;n de elementos constitutivos de una vivienda MODELO solicitud_modelo / solicitud_total_de_metros_cuadrados mts2 INTERNOS, de solicitud_total_de_metros_cuadrados m2 de superficie cubierta, medidas interiores en metros y conforme las condiciones t&eacute;cnicas que se se&ntilde;alan en el ANEXO I, que forma parte integrante del presente contrato.</li>	<li style="text-align: justify;">El armado de la vivienda a que se refiere el punto A.</li></ol><p style="text-align: justify;">El presente contrato no involucra una vivienda llave en mano, encontr&aacute;ndose sujeto a las condiciones particulares de cada caso.<br /><strong><u>LA LOCADORA</u></strong> se obliga al cumplimiento del objeto solicitado, fijando ambas partes que la fabricaci&oacute;n de los elementos constitutivos y el armado de la vivienda, constituyen un solo objeto contractual &uacute;nico e inescindible. La descripci&oacute;n de los elementos constitutivos se se&ntilde;alan en el ANEXO III del presente contrato, formando parte del mismo.<br /><u>El armado de la vivienda no incluye la base o platea sobre la que se plantar&aacute; la misma, siendo la ejecuci&oacute;n de la misma por cuenta y costo de EL/LA LOCATARIO/A.</u><br />En tal sentido EL/LA LOCATARIO/A se obliga a la realizaci&oacute;n de la base, con materiales adecuados y suficientes, que permitan el armado de la vivienda sobre la mencionada platea, todo ello conforme al ANEXO IV del presente contrato, siendo los datos y dem&aacute;s condiciones del terreno responsabilidad exclusiva de EL/LA LOCATARIO/A y no sujetos a verificaci&oacute;n por parte de LA LOCADORA.<br />Asimismo queda bajo responsabilidad de LA LOCATARIA la realizaci&oacute;n de la carpeta interior de la vivienda que permite la fijaci&oacute;n de las paredes impidiendo que las mismas sufran roturas o desplazamientos y ello, en un plazo de 24 horas a partir de la fecha de armado de los elementos constitutivos, objeto de este contrato.</p><p style="text-align: justify;"><strong><u>SEGUNDA: </u></strong></p><p style="text-align: justify;">Sin perjuicio de lo establecido en la cl&aacute;usula PRIMERA, EL/LA LOCATARIO/A solicita a LA LOCADORA, la modificaci&oacute;n del modelo se&ntilde;alado conforme lo siguiente:</p><p style="text-align: justify;">solicitud_componentes</p><p style="text-align: justify;">Siendo la misma acorde a sus necesidades habitacionales.LA LOCADORA acepta las modificaciones en la medida que no obliguen al cambio de las condiciones t&eacute;cnicas del ANEXO I antes mencionado y adjunto. EL/LA LOCATARIO/A se obliga a mantener la descripci&oacute;n y constituci&oacute;n del objeto contratado y mantener la misma al momento del armado de la vivienda. Todo ello conforme el ANEXO II que se acompa&ntilde;a al presente.</p><p style="text-align: justify;"><strong><u>TERCERA: </u></strong></p><p style="text-align: justify;">Siendo que LA LOCADORA se hace cargo del armado de la vivienda, en lote o terreno de propiedad de EL/LA LOCATARIO/A o sobre el cual la misma tuviere derecho, el mismo deber&aacute; indicar ubicaci&oacute;n geogr&aacute;fica y acreditar vinculaci&oacute;n con el lugar de posterior armado de la vivienda y medidas del mismo. Estas &uacute;ltimas se agregan en el ANEXO IV, siendo su precisi&oacute;n y justeza de esponsabilidad de EL/LA LOCATARIO/A.LOCATARIO/A.</p><p style="text-align: justify;">LA LOCADORA puede rehusarse a armar la vivienda en el lote se&ntilde;alado por el locatario cuando:</p><ol>	<li style="text-align: justify;">No se acreditare relaci&oacute;n alguna del lote con el signatario del contrato.</li>	<li style="text-align: justify;">Cuando no se hubiere construido la platea o base de apoyo de la que se se&ntilde;ala en el anexo IV cl&aacute;usula CUARTA del presente, o la misma estuviere ejecutada fuera de las normas de buenas pr&aacute;cticas de construcci&oacute;n, y/o dicha platea se encontrare fuera de la indicaci&oacute;n f&iacute;sica y/o material que se&ntilde;ala el respectivo anexo</li>	<li style="text-align: justify;">No se encontraren los pagos acordados en el contrato efectivizado al momento del armado, y sin perjuicio de lo dispuesto por la cl&aacute;usula SEXTA del presente contrato.</li></ol><p style="text-align: justify;">Cualquiera de estas conductas de EL/LA LOCATARIO/A provocan el nacimiento de da&ntilde;os y perjuicios a favor de LA LOCADORA, en tanto efectiva incurrencia en gastos de transporte, mano de obra y p&eacute;rdida de chance. Sin perjuicio de lo anterior LA LOCADORA, podr&aacute; proceder al armado de la vivienda, bajo las condiciones especiales que pacte con EL/LA LOCATARIO/A, y a riesgo exclusivo de la misma en los supuestos A. y B.</p><p style="text-align: justify;"><strong><u>CUARTA:</u> PRECIO-FORMA DE PAGO</strong></p><p style="text-align: justify;"><strong><u>Todo Financiado:</u></strong></p><p style="text-align: justify;">El precio total del presente contrato es fijado en la suma de solicitud_suma_total, cantidad que EL/LA LOCATARIO/A se obliga a abonar de la siguiente forma: solicitud_cuotas_contrato cuotas iguales y consecutivas de solicitud_monto_cuotas_contrato operando el vencimiento de cada cuota de ella a los 30 d&iacute;as de la suscripci&oacute;n del presente contrato, siendo el vencimiento de las restantes el mismo d&iacute;a de los meses subsiguientes.<br />La entrega de los elementos constitutivos de la vivienda opera a partir del pago de la cuota n&uacute;mero 12 (doce), debiendo EL/LA LOCATARIO/A efectivizar antes de la entrega las condiciones estipuladas en la CLAUSULA DECIMO PRIMERA del presente contrato. A los fines de este contrato se considera ANTICIPO el equivalente a las primeras 12 (doce).<br />En caso que no se cumpliera con el pago del ANTICIPO en los primeros 12 meses de vigencia del contrato, existiendo mora en las cuotas cualquiera fuera la misma, a solo criterio de LA LOCADORA esta podr&aacute; reformular el valor del saldo del contrato conforme precio al momento de la finalizaci&oacute;n del pago, o rescindir el contrato, devolviendo hasta el 50% del valor entregado por LA LOCATARIA.</p><p style="text-align: justify;">Lugar de pago: Las cuotas ser&aacute;n abonadas entre el 1 y 10 d&iacute;as del mes que corresponda a cada una de ellas en sucursal_domicilio, sucursal_localidad.</p><p style="text-align: justify;"><strong><u>INTERESES:</u></strong></p><p style="text-align: justify;">La falta de cumplimiento en tiempo y forma de los pagos provocar&aacute; el devengamiento de intereses compensatorios de 2,5% mensual a los que se adicionar&aacute; un 1,5 % en concepto de punitorios, que conforme la condici&oacute;n de mora autom&aacute;tica se adicionar&aacute; al pago que se efect&uacute;e tard&iacute;amente. En el caso que sea exigible la totalidad del saldo deudor como consecuencia de la caducidad de los plazos, los intereses fijados m&aacute;s arriba se devengar&aacute;n a partir de la notificaci&oacute;n fehaciente a EL/LA LOCATARIO/A de la voluntad de LA LOCADORA de dar por caduco todo plazo acordado.</p><p style="text-align: justify;"><strong><u>QUINTA:</u> MORA</strong></p><p style="text-align: justify;">Las partes pactan que la mora se producir&aacute; de manera autom&aacute;tica por la falta de cumplimento en legal forma de las condiciones y modalidades de las obligaciones pactadas en el presente contrato no siendo necesaria la interpelaci&oacute;n judicial o extrajudicial alguna para su constituci&oacute;n.</p><p style="text-align: justify;"><strong>REFORMULACION DEL PRECIO DEL CONTRATO.</strong> En supuestos de mora de m&aacute;s de un a&ntilde;o en el pago de cuotas del contrato, y sin perjuicio de lo dispuesto en la cl&aacute;usula CUARTA en relaci&oacute;n al anticipo, LA LOCADORA tendr&aacute; derecho a la reformulaci&oacute;n del saldo del contrato conforme precio al momento de la normalizaci&oacute;n y reconducci&oacute;n del pago o eventual ejecuci&oacute;n y cobro, pudiendo mantener la forma de pago convenida en el contrato, a su solo criterio en el primer supuesto.</p><p style="text-align: justify;"><strong><u>SEXTA:</u> RESCISION</strong></p><p style="text-align: justify;">Sin perjuicio del derecho de rescisi&oacute;n de que ambas partes gozan conforme ley aplicable, se pacta expresamente que <strong><u>LA LOCADORA</u></strong>, tendr&aacute; derecho a rescindir unilateralmente y a su sola voluntad, el presente contrato en los siguientes supuestos:</p><ol>	<li style="text-align: justify;">Falta de pago de suma alguna de anticipo.</li>	<li style="text-align: justify;">Falta de pago de dos cuotas seguidas o cinco alternadas del anticipo.</li>	<li style="text-align: justify;">Falta de pago de cuotas del contrato, a&uacute;n en el caso que el anticipo hubiere sido pagado, en cuando el mismo no fuere igual o superior al 40 % del total del precio.</li>	<li style="text-align: justify;">Haberse producido algunos de los hechos que describe la cl&aacute;usula TERCERA, inciso A) o B)</li>	<li style="text-align: justify;">Falta de constituci&oacute;n en tiempo y forma de la garant&iacute;a de pago del presente contrato.</li></ol><p style="text-align: justify;">En estos supuestos las sumas entregadas ser&aacute;n aplicadas a da&ntilde;os y perjuicios ocasionados a LA LOCADORA en cuanto costos de mano de obra, materiales, p&eacute;rdida de chance y/o cualquier otra que hubiere generado la suscripci&oacute;n del contrato y/o su principio de ejecuci&oacute;n, no teniendo EL/LA LOCATARIO/A derecho a reclamo alguno.<br />En caso de que LA LOCATARIA resuelva unilateralmente el contrato por razones ajenas a LA LOCADORA, esta &uacute;ltima proceder&aacute; a LA DEVOLUCI&Oacute;N de las sumas recibidas hasta un 50 % y conforme modalidad de pago que ambas partes de com&uacute;n acuerdo resuelvan.</p><p style="text-align: justify;"><strong><u>SEPTIMA:</u> CADUCIDAD DE LOS PLAZOS</strong></p><p style="text-align: justify;">Sin perjuicio del derecho rescisorio que pudiere ejercer LA LOCADORA, conforme la cl&aacute;usula sexta, las partes pactan que la falta de pago dentro del plazo estipulado de dos cuotas del saldo del precio ya sean estas alternadas o consecutivas, dar&aacute; derecho a LA LOCADORA, a dar por caducos todos los plazos acordados para el pago de precio pactado, haci&eacute;ndose exigible el saldo del precio en su totalidad y desde el momento de producirse la mora.<br />La voluntad de dar por caduco los plazos deber&aacute; ser notificada por LA LOCADORA por medio fehaciente y acordando un plazo no menor de 15 d&iacute;as para que EL/LA LOCATARIO/A pueda dar cumplimiento al pago de la totalidad del saldo requerido.<br />La tolerancia de LA LOCADORA no ser&aacute; interpretada como una renuncia al ejercicio del presente derecho, en cualquier momento del desarrollo del contrato, y a&uacute;n en el caso de incumplimiento anteriores no afectados por la mencionada caducidad de plazos.</p><p style="text-align: justify;"><strong><u>OCTAVA:</u> ENTREGA DE LOS COMPONENTES- CONDICIONES</strong></p><p style="text-align: justify;">La entrega de los componentes fijados en el ANEXO III, se efectuar&aacute; una vez que fuere pagado el anticipo fijado en el presente contrato, as&iacute; como los gastos administrativos del total de la operacion efectuada (3% del valor del contrato), el sellado del presente y documentos que genera el mismo. La mora en el pago del anticipo o en su caso la existencia de cuotas pendientes da el derecho a LA LOCADORA de no entregar los componentes ni proceder al armado de la vivienda, objeto del contrato, sin derecho a reclamo por parte de EL/LA LOCATARIO/A al respecto. LA LOCADORA deber&aacute; entregar los componentes y proceder al armado de la vivienda en un plazo que no podr&aacute; exceder los 90 d&iacute;as h&aacute;biles desde la constituci&oacute;n de las garant&iacute;as que fija la cl&aacute;usula DECIMO PRIMERA, as&iacute; como del pago total del anticipo.<br />Se deja establecido que en caso de demora en la entrega y/o armado de los componentes fundada en caso fortuito o fuerza mayor, huelga del personal, la falta en plaza de los elementos para la elaboraci&oacute;n de los componentes o cualquier otra causa o hecho imprevisto no imputable a LA LOCADORA que impida a esta &uacute;ltima dar cumplimiento de lo pactado en este contrato no lo har&aacute; responsable de las consecuencias del retardo.<br />La entrega de los componentes no incluye los &aacute;ridos para el armado, los que deber&aacute;n ser aportados por EL/LA LOCATARIO/A, as&iacute; como la mano de obra para la colocaci&oacute;n de ladrillos, salvo pacto expreso con LA LOCADORA.</p><p style="text-align: justify;"><strong><u>NOVENA</u> TRASLADO DE LOS COMPONENTES- ARMADO</strong></p><p style="text-align: justify;">Los elementos constitutivos de la vivienda ser&aacute;n entregados al locatario &ldquo;en f&aacute;brica&rdquo; por lo que todos los gastos que irrogue el traslado de los mismos ser&aacute;n a cargo exclusivo de EL/LA LOCATARIO/A. Tambi&eacute;n ser&aacute;n a cargo de la EL/LA LOCATARIO/A los gastos de armado de la vivienda, actividad que deber&aacute; ser ejecutada por el locador. Los gastos correspondientes a este &uacute;ltimo rubro deber&aacute;n ser pagados en la misma oportunidad de retirar los componentes de la f&aacute;brica. En el supuesto que el locatario proceda a retirar de f&aacute;brica los componentes de la vivienda y no abone de la manera estipulada los gastos de armado cesa autom&aacute;ticamente la obligaci&oacute;n del locador de proceder al armado de la vivienda no haci&eacute;ndose responsable de los da&ntilde;os que sufran los componentes luego de ser retirados de f&aacute;brica y los que sufran en el intento de armado por parte del locatario o de tercera persona contratada por este.</p><p style="text-align: justify;"><strong><u>DECIMA:</u></strong></p><p style="text-align: justify;">EL/LA LOCATARIO/A toma a su exclusivo cargo todo tr&aacute;mite de gesti&oacute;n para la obtenci&oacute;n de los permisos indispensables para la instalaci&oacute;n y/o habilitaci&oacute;n que correspondiera de la vivienda de que se trate, incluyendo sin limitar provisiones de servicios domiciliarios, eximiendo a la locadora toda responsabilidad por los resultados de dichas gestiones. Adem&aacute;s, la locataria asume de manera exclusiva y excluyente la obligaci&oacute;n de pagar los impuestos, gastos administrativos y dem&aacute;s erogaciones que demande la formalizaci&oacute;n de &eacute;ste contrato.</p><p style="text-align: justify;"><strong><u>DECIMO PRIMERA:</u></strong></p><p style="text-align: justify;">Cumplido el pago del anticipo por parte de LA LOCATARIA para el posterior armado y antes del mismo LA LOCATARIA se obliga a aportar a EL LOCADOR, conforme anexo V, las garant&iacute;as reales y/o personales a satisfacci&oacute;n de este &uacute;ltimo, que se constituyan en LISO, LLANO, PRINCIPAL PAGADOR de todas las obligaciones de este contrato y sus anexos, de forma inmediata y en un plazo no superior a quince d&iacute;as h&aacute;biles desde la cancelaci&oacute;n del anticipo.<br />La falta de cumplimiento por parte de LA LOCATARIA de esta cl&aacute;usula otorga a EL/LA LOCATARIO/A el derecho de rescindir, a su solo criterio, el presente contrato sin derecho a reclamo alguno por parte de EL/LA LOCATARIO/A, quedando las sumas entregadas hasta la fecha aplicadas a costos, gastos administrativos y da&ntilde;os y perjuicios ocasionados, sin perjuicio de exigir mayores sumas por tales conceptos en la medida que correspondieren.<br />EL/LA LOCATARIO/A se obliga a reemplazar al Fiador presentado en caso de devenir el mismo desempleado o insolvente, proponiendo una nueva FIANZA, bajo apercibimiento de rescisi&oacute;n.LA LOCADORA podr&aacute; solicitar de tanto en tanto, y de acuerdo a su criterio documentaci&oacute;n que permita corroborar la vigencia de solvencia del fiador propuesto.</p><p style="text-align: justify;"><strong><u>DECIMO SEGUNDA:</u> FIJACION DE DOMICILIO</strong></p><p style="text-align: justify;">Para todos los efectos del presente contrato, las partes fijan domicilio especial en los que respectivamente han denunciado en el encabezado del presente, siendo en dichos lugares eficaces todas las notificaciones y/o intimaciones que se cursen ya sean judiciales o extrajudiciales debiendo quien modifique los mismos hacerlo saber a EL LOCADOR por medio de carta documento y/o telegrama colacionado y/u otro medio fehaciente.</p><p style="text-align: justify;">En la ciudad de cliente_localidad provincia de cliente_provincia a los contrato_dia d&iacute;as del mes de contrato_mes del a&ntilde;o contrato_anio se firman dos ejemplares de un mismo tener y efecto.</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%">	<tbody>		<tr>			<td>			<p style="text-align: justify;">LOCADOR:</p>			</td>			<td>			<p style="text-align: justify;">LOCATARIO:</p>			</td>		</tr>		<tr>			<td style="text-align:justify">..........................................................................</td>			<td style="text-align:justify">..........................................................................</td>		</tr>		<tr>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>			<td style="text-align:justify">ACLARACI&Oacute;N:</td>		</tr>		<tr>			<td>			<p style="text-align: justify;">..........................................................................</p>			</td>			<td style="text-align:justify">..........................................................................</td>		</tr>	</tbody></table>', '2019-01-08 23:07:04', '2019-01-09 22:35:04'),
