(10, 1, 'Normas', '<h1 style="text-align:center">NORMAS PARA LA CONSTRUCCION DE PLATEA</h1><h1 style="text-align:center">ANEXO IV</h1><p>&nbsp;</p><p>Fecha: ...............................................................................</p><p>&nbsp;</p><p>Nombre y Apellido: .................................................................................................................................</p><p>Direcci&oacute;n: .......................................................................... Tel.: ...........................................................</p><p><strong>1. PLATEA</strong></p><p>Deber&aacute; realizarse a un nivel superior al de la vereda, con una medida de un metro m&aacute;s largo y un metro m&aacute;s ancho que el modelo de la vivienda adquirida. Su espesor deber&aacute; ser de 0.15 a 0.25 mts. de alto como m&iacute;nimo y deber&aacute; encontrarse en PERFECTA ESCUADRA Y NIVEL. Sin ca&ntilde;erias ni desag&uuml;es.</p><p><strong>2. LA PROPORCION</strong></p><p>Partes: nueve (9) partes de granza fina, dos (2) de plasticor, una (1) parte de arena y media parte (1/2) de cemento portland.</p><p><strong>3. ACCESO</strong></p><p>El acceso al lote deber&aacute; estar libre de malezas y otros objetos que obstaculizen el libre tr&aacute;nsito de mercader&iacute;a, material y personal de ensamble.</p><p><strong>4.INCUMPLIMIENTO</strong></p><p>El incumplimiento de dichas normas, y la sola constataci&oacute;n por personal de VIVIENDAS TECNOHOUSE DE SISTEMA DE VIVIENDAS TECNOHOGAR S.R.L. hace posible el retorno a f&aacute;brica de todos los materiales debiendo efectuarse en ese mismo instante un nuevo acuerdo de entrega responsabiliz&aacute;ndose el LOCATARIO por la integridad de dichos materiales, abonando nuevamente los gastos que todo ellos genere.</p><p>En prueba de conformidad se firman dos ejemplares de un mismo tenor y a un solo efecto en la ciudad de<br /><br />.......................................................................... a los ............... d&iacute;as de .............................. de 20...........</p><p>&nbsp;</p><p>&nbsp;</p><p>FIRMA: ............................................................</p><p>ACLARACION: ..................................................</p>', '2019-01-09 19:00:11', '2019-01-09 22:02:03'),
