(14, 1, 'Requisitos', '<ul>	<li style="text-align: justify;"><strong><u>ADQUIRIENTE</u></strong>: COMPLETA TITULAR DEL CONTRATO, ADJUNTANDO FOTOCOPIA DEL DNI (1&ordm; Y 2&ordm; HOJA). FIRMA AL PIE.<br />	&nbsp;</li>	<li style="text-align: justify;"><strong>CO-DEUDOR</strong>: COMPLETAN LOS TRES (3) GARANTES, ADJUNTANDO CADA UNO DE ELLOS, FOTOCOPIA DEL DNI (1&ordm; Y 2&ordm; HOJA) Y ULTIMO RECIBO DE SUELDO. FIRMA AL PIE.	<ul style="list-style-type:circle">		<li>(EN CASO QUE UNO DE LOS GARANTES, PRESENTE ESCRITURA PROPIETARIA; LA MISMA NO PUEDE SER BIEN DE FAMILIA).</li>		<li><strong><u>NO SE ACEPTAN</u></strong>: ESCRITURAS EN JUICIO SUCESORIO. BOLETO DE COMPRA VENTA. MONOTRIBUTOS. HABERES JUBILATORIOS.<br />		&nbsp;</li>	</ul>	</li>	<li style="text-align: justify;"><strong>PAGAR&Eacute;</strong>: LO FIRMAN EL TITULAR Y LOS GARANTES.	<ul style="list-style-type:circle">		<li>LIBRADOR: ES EL TITULAR DEL CONTRATO. COMPLETA LOS DATOS SOLICITADOS. FIRMA Y ACLARA A LA DERECHA.</li>		<li>POR AVAL: PRIMER GARANTE. COMPLETA LOS DATOS SOLICITADOS. FIRMA Y ACLARA A LA DERECHA.</li>		<li>POR AVAL: SEGUNDO GARANTE. COMPLETA LOS DATOS SOLICITADOS. FIRMA Y ACLARA A LA DERECHA.</li>		<li>POR AVAL: TERCER GARANTE. COMPLETA LOS DATOS SOLICITADOS. FIRMA Y ACLARA A LA DERECHA.</li>		<li>LAS FIRMAS DEBEN ESTAR CERTIFICADAS ANTE UN ESCRIBANO. NO SE COMPLETAN FECHAS.</li>	</ul>	</li></ul><p style="text-align: justify;">&nbsp;</p><p>Firma y aclaraci&oacute;n del titular del contrato:</p><p>&nbsp;</p><p>____________________________________</p><p>(Devolver firmado junto a la documentaci&oacute;n)</p><p>&nbsp;</p><p style="text-align: justify;">Si las garant&iacute;as solicitas se encuentran incompletas, el contrato no pasar&aacute; a f&aacute;brica.</p>', '2019-01-09 18:11:11', '2019-01-09 22:25:52'),
