(16, 1, 'Autorizacion Foto', '<p>&nbsp;</p><p>Se&ntilde;ores</p><p>&nbsp;</p><p>De mi consideraci&oacute;n</p><p>&nbsp;</p><p>Por la presente autorizo a VIVIENDAS TECNOHOUSE DE SISTEMAS DE VIVIENDAS TECNOHOGAR S.R.L., a publicitar sus servicios utilizando fotografia, gigantograf&iacute;a, impresa o digital o cualquier medio gr&aacute;fico sin limitaci&oacute;n y / o en publicidad v&iacute;a Televisi&oacute;n, P&aacute;gina Web, redes sociales y / o cualquier otro, de la vivienda que fue armada y entregada a mi parte.</p><p>&nbsp;</p><p>Dicha autorizaci&oacute;n se concede bajo la condici&oacute;n de preservar los datos personales y familiares del firmante y se concede en forma absolutamente gratuita e incondicional.</p><p>&nbsp;</p><p>Atentamente,</p><p>FIRMA: ........................................................</p><p>ACLARACION: ............................................</p><p>D.N.I.: ..........................................................</p><p>DOMICILIO COMPLETO DE LA VIVIENDA:................................................................................................</p>', '2019-01-10 00:39:48', '2019-01-10 00:40:08'),
(17, 1, 'Publicidad', '<h2>SU OPINION NOS INTERESA</h2><p>&nbsp;</p><p><strong>&iquest;Como nos conoci&oacute;?</strong></p><p>Por favor marque y/o complete lo que corresponda.</p><table border="0" cellpadding="1" cellspacing="1" style="width:100%">	<tbody>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>			</table>			</td>			<td>Publicidad Televisa (Programaci&oacute;n / Canal): ..................................................................................................</td>		</tr>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>			</table>			</td>			<td>Publicidad Gr&aacute;fica (Diario / Peri&oacute;dico / Revista): ..........................................................................................</td>		</tr>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>			</table>			</td>			<td>Publicidad Radial (Radio / Programa): ..........................................................................................</td>		</tr>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>			</table>			</td>			<td>P&aacute;gina Web</td>		</tr>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>			</table>			</td>			<td>Publicidad en Facebook</td>		</tr>		<tr>			<td style="width:30px">			<table border="1" cellpadding="1" cellspacing="1" style="height:20px; width:30px">				<tbody>					<tr>						<td>&nbsp;</td>					</tr>				</tbody>		