(18, 1, 'Garantes encabezado', '<h1 style="text-align:center">CONSTITUCI&Oacute;N DE GARANT&Iacute;AS:</h1><p>Conforme a la Cla&uacute;sula D&eacute;cimo Primera del contrato N&ordm; solicitud_id Sr./Sra. (cliente_id) cliente_apellido cliente_nombre titular del cliente_tipo_de_documento cliente_nro_de_documento con domicilio real en calle de cliente_domicilio la ciudad de cliente_localidad, provincia de cliente_provincia.</p>', '2019-01-11 02:27:57', '2019-01-11 02:58:08'),
(19, 1, 'Garantes cuerpo', '<p>Por el presente SE CONSTITUYE EN LISO, LLANO, orden_pagador PAGADOR y FIADOR de EL/LA LOCATARIO/A, garante_apellido garante_nombre, titular garante_tipo_de_documento, con domicilio en garante_domicilio, que acredita solvencia con inmueble sito en calle garante_inmueble, inscripto al Tomo garante_tomo, Folio garante_folio, Nro garante_numero, garante_departamento &nbsp;y/o con tres &uacute;ltimos recibos de sueldo, que se acompa&ntilde;an al presente como parte integrante del mismo.<br />EL/LA LOCATARIO/A se obliga a reemplazar al Fiador presentado en caso de devenir el mismo desempleado o insolvente, proponiendo una nueva FIANZA, bajo apercibimiento de rescisi&oacute;n.<br />LA LOCADORA podr&aacute; solicitar de tanto en tanto, y de acuerdo a su criterio documentaci&oacute;n que permita corroborar la vigencia de solvencia del fiador propuesto.</p><p>&nbsp;</p><p><strong>Firma:</strong></p><p><strong>Aclaraci&oacute;n:</strong></p><p>&nbsp;</p>', '2019-01-11 02:28:34', '2019-01-11 02:57:37');

